--
-- Name: packages_unified; Type: VIEW; Schema: public; Owner: neondb_owner
--

CREATE VIEW public.packages_unified AS
 SELECT sp.id,
    'session'::text AS package_type,
    sp.package_name,
    sp.student_id,
    sp.total_sessions AS total_units,
    'sessions'::text AS unit_type,
    sp.session_duration AS unit_duration,
    sp.used_sessions AS used_units,
    sp.remaining_sessions AS remaining_units,
    sp.price,
    sp.status,
    NULL::text AS description,
    NULL::text AS package_type_category,
    NULL::text AS target_level,
        CASE
            WHEN ((sp.status)::text = 'active'::text) THEN true
            ELSE false
        END AS is_active,
    sp.purchased_at,
    sp.expires_at,
    sp.notes,
    sp.created_at,
    sp.updated_at
   FROM public.session_packages sp
UNION ALL
 SELECT (cp.id + 100000) AS id,
    'callern'::text AS package_type,
    cp.package_name,
    NULL::integer AS student_id,
    cp.total_hours AS total_units,
    'hours'::text AS unit_type,
    NULL::integer AS unit_duration,
    0 AS used_units,
    cp.total_hours AS remaining_units,
    cp.price,
        CASE
            WHEN cp.is_active THEN 'active'::character varying
            ELSE 'inactive'::character varying
        END AS status,
    cp.description,
    cp.package_type AS package_type_category,
    cp.target_level,
    cp.is_active,
    NULL::timestamp without time zone AS purchased_at,
    NULL::timestamp without time zone AS expires_at,
    NULL::text AS notes,
    cp.created_at,
    cp.updated_at
   FROM public.callern_packages cp;


ALTER VIEW public.packages_unified OWNER TO neondb_owner;

