    supervisor_notified boolean DEFAULT false,
    admin_notified boolean DEFAULT false,
    created_at timestamp without time zone DEFAULT now() NOT NULL,
    updated_at timestamp without time zone DEFAULT now() NOT NULL,
    CONSTRAINT teacher_availability_periods_class_format_check CHECK ((class_format = ANY (ARRAY['online'::text, 'in-person'::text, 'hybrid'::text]))),
    CONSTRAINT teacher_availability_periods_day_of_week_check CHECK ((day_of_week = ANY (ARRAY['Monday'::text, 'Tuesday'::text, 'Wednesday'::text, 'Thursday'::text, 'Friday'::text, 'Saturday'::text, 'Sunday'::text]))),
    CONSTRAINT teacher_availability_periods_time_division_check CHECK ((time_division = ANY (ARRAY['morning'::text, 'afternoon'::text, 'evening'::text, 'full-day'::text])))
);


ALTER TABLE public.teacher_availability_periods OWNER TO neondb_owner;

--
-- Name: teacher_availability_compat; Type: VIEW; Schema: public; Owner: neondb_owner
--

CREATE VIEW public.teacher_availability_compat AS
 SELECT id,
    teacher_id,
    day_of_week,
        CASE
            WHEN (time_division = 'morning'::text) THEN '08:00:00'::time without time zone
            WHEN (time_division = 'afternoon'::text) THEN '14:00:00'::time without time zone
            WHEN (time_division = 'evening'::text) THEN '18:00:00'::time without time zone
            ELSE '08:00:00'::time without time zone
        END AS start_time,
        CASE
            WHEN (time_division = 'morning'::text) THEN '12:00:00'::time without time zone
            WHEN (time_division = 'afternoon'::text) THEN '18:00:00'::time without time zone
            WHEN (time_division = 'evening'::text) THEN '22:00:00'::time without time zone
            ELSE '22:00:00'::time without time zone
        END AS end_time,
    is_active,
    created_at,
    updated_at
   FROM public.teacher_availability_periods tap
  WHERE ((is_active = true) AND (period_start_date <= CURRENT_DATE) AND (period_end_date >= CURRENT_DATE));


ALTER VIEW public.teacher_availability_compat OWNER TO neondb_owner;

