--
-- Name: users_consolidated; Type: VIEW; Schema: public; Owner: neondb_owner
--

CREATE VIEW public.users_consolidated AS
 SELECT u.id,
    u.email,
    u.password,
    u.first_name,
    u.last_name,
    u.role,
    u.phone_number,
    u.gender,
    u.profile_image,
    u.status,
    u.avatar,
    u.is_active,
    u.is_available_to_socialize,
    u.socializer_level,
    u.socializer_skills,
    u.preferences,
    u.wallet_balance,
    u.total_credits,
    u.member_tier,
    u.streak_days,
    u.total_lessons,
    u.created_at,
    u.updated_at,
    COALESCE(up.national_id, (u.national_id)::text) AS profile_national_id,
    COALESCE(up.birthday, u.birthday) AS profile_birthday,
    COALESCE(up.guardian_name, (u.guardian_name)::text) AS profile_guardian_name,
    COALESCE(up.guardian_phone, (u.guardian_phone)::text) AS profile_guardian_phone,
    COALESCE(up.notes, u.notes) AS profile_notes,
    up.native_language,
    up.target_languages,
    up.current_proficiency,
    up.current_level,
    up.target_language,
    up.cultural_background,
    up.learning_goals,
    up.learning_style,
    up.timezone,
    up.preferred_study_time,
    up.weekly_study_hours,
    up.personality_type,
    up.motivation_factors,
    up.learning_challenges,
    up.strengths,
    up.interests,
    up.bio
   FROM (public.users u
     LEFT JOIN public.user_profiles up ON ((u.id = up.user_id)));


ALTER VIEW public.users_consolidated OWNER TO neondb_owner;

